import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import '../styles/BookTour.css';

const BookTour = () => {
  const [step, setStep] = useState(1);
  const [formData, setFormData] = useState({
    location: '',
    firstName: '',
    lastName: '',
    phone: '',
    email: '',
    desks: '',
    startDate: '',
    interest: '',
  });

  const [selectedMonth, setSelectedMonth] = useState('January');
  const [selectedDate, setSelectedDate] = useState('');
  const navigate = useNavigate();

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const getDaysInMonth = (month) => {
    const monthIndex = ['January', 'February', 'March'].indexOf(month);
    const year = 2025;
    return new Date(year, monthIndex + 1, 0).getDate();
  };

  const nextStep = () => {
    if (step < 2) setStep(step + 1);
  };

  const prevStep = () => {
    if (step > 1) setStep(step - 1);
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    if (!selectedMonth || !selectedDate) {
      alert('Please select both a month and a date.');
      return;
    }

    console.log('Form Submitted:', { ...formData, selectedMonth, selectedDate });
    navigate('/thank-you');
  };

  return (
    <div className="book-tour">
      <h2>Book a tour</h2>
      <div className="steps">
        <div className={`step ${step === 1 ? 'active' : ''}`}>
          <span>1</span>
        </div>
        <span className={`step-label ${step === 1 ? 'active' : ''}`}>About you</span>

        <div className={`step ${step === 2 ? 'active' : ''}`}>
          <span>2</span>
        </div>
        <span className={`step-label ${step === 2 ? 'active' : ''}`}>Date & time</span>
      </div>

      {step === 1 && (
        <form>
          {/* Step 1 Form */}
          <div className="form-group">
            {/* Other input fields */}
          </div>

          <div className="form-buttons">
            <button type="button" onClick={nextStep} className="next-button">
              Agree and proceed →
            </button>
          </div>
        </form>
      )}

      {step === 2 && (
        <form onSubmit={handleSubmit}>
          <div>
            <h3>Select Date & Time</h3>

            {/* Month Selection */}
            <div className="month-tabs">
              {['January', 'February', 'March'].map((month) => (
                <button
                  type="button"
                  key={month}
                  className={selectedMonth === month ? 'active' : ''}
                  onClick={(e) => {
                    e.preventDefault();
                    setSelectedMonth(month);
                  }}
                >
                  {month}
                </button>
              ))}
            </div>

            {/* Day Selection */}
            <div className="days-picker">
              {[...Array(getDaysInMonth(selectedMonth))].map((_, index) => {
                const day = index + 1;
                return (
                  <button
                    type="button"
                    key={day}
                    className={selectedDate === day ? 'active' : ''}
                    onClick={(e) => {
                      e.preventDefault();
                      setSelectedDate(day);
                    }}
                  >
                    {day}
                  </button>
                );
              })}
            </div>
          </div>

          <div className="form-buttons">
            <button type="button" onClick={prevStep} className="prev-button">
              ← Back
            </button>
            <button type="submit" className="submit-button">
              Book Me In!
            </button>
          </div>
        </form>
      )}
    </div>
  );
};

export default BookTour;
